t for not happening this in future. \r\n','madiha Khan','madiha.khan@binrasheed.com','Completed','C-20210215070151-WhatsAppImage2021-02-13at9.06.45PM.jpeg','Feb','2021','2021-02-16 07:16',NULL,NULL),(16,'2021-02-15','4','Sales','Beige/Brown/Chocolate','SERVICE INDUSTRIES LTD','PT-8949','11622','Finished Good Testing','Shoe Sole','Not-Applicable ','Polyol ','10','17','Yes','Defective product sample','customer has approved this color after many trials, but now when supplier send to them, it has different color than the standard and approved sample color, customer wants to resolve this issue on urgent basis. \r\n','madiha Khan','madiha.khan@binrasheed.com','Completed','C-20210215071052-WhatsAppImage2021-02-15at9.29.37AM.jpeg','Feb','2021','2021-02-16 07:21',NULL,NULL),(17,'2021-02-22','2','Sales','White','METATEX (PRIVATE) LIMITED','BR-W444A','117341','Finished Good Testing','PE FILM','Available - 10%','PE','6','3','Yes','Defective product sample','There are spot\\ particles visible on film. either its unmelt paticles or small clusters. Please check defected samples which are already dispatched to you. They pre heated the masterbatch before usage at 50-60C for 3-4 hrs.','Javed Ansari','j.ahmed@binrasheed.com','Pending','','Feb','2021',NULL,NULL,NULL),(18,'2021-02-22','2','Sales','White','METATEX (PRIVATE) LIMITED','BR-CP-04','117493','Finished Good Testing','CPP FILM','Available - 12%','PP CAST','24','3','Yes','Defective product sample','There are spot\\ particles visible on film. either its unmelt paticles or small clusters. Please check defected samples which are already dispatched to you. They pre heated the masterbatch before usage at 50-60C for 3-4 hrs.','Javed Ansari','j.ahmed@binrasheed.com','Pending','','Feb','2021',NULL,NULL,NULL),(19,'2021-02-26','2','Sales','White','DAR PLASTIC INDUSTRIES','BR-SW76BPLM','116181(DP) 20.08.20','Finished Good Testing','Blow Molding (Water Tank) ','Not-Applicable ','HDPE','3','16','Yes','Standard Product Sample ','Customer found metal inside masterbatches, it has magnetic force. ','Khurram Naveed ','k.naveed@binrasheed.com','Pending','C-20210226074242-darplastic.mp4','Feb','2021',NULL,NULL,NULL),(23,'2021-03-26','5','Sales','Green','2 Star Plastic Fsd','Ajmal Blue ink for AQF','testing','Finished Good Testing','testing','Pure','testing','17','70','Yes','Defective and Standard Sample','testing ','ALI ','alirazagohar1@gmail.com','Completed','','Mar','2021','2021-04-22 12:28',NULL,NULL),(24,'2021-03-26','2','Sales','Black','2 Star Plastic','Akrilux Black','testing','Finished Good Testing','testing','Available - 1','testing','6','49','No','','for testing purpose','ALI ','alirazagohar1@gmail.com','Pending','','Mar','2021',NULL,NULL,NULL),(25,'2021-04-02','31','Sales','Black','Waves Singer Pakistan Limited ','BR-1507','01530','In-Process Testing','Home Appliances (Injection Molding)','Available - 3%','ABS','20','38','Yes','Defective and Standard Sample','The material was\'t heat stable and the white color was getting yellowish after every 3 or 4 shots','Mustafa Kashif','mb.kashif@binrasheed.com','Objected','C-20210402064609-wavescomplaint.PNG','Apr','2021','2021-04-28 11:26',NULL,NULL),(26,'2021-04-09','2','Sales','Orange','K S F TRI-ZONE INDUSTRIES (PVT ) LIMITED','BR-3137-N','December 2020','In-Process Testing','HDPE Tarpuline','Not-Applicable ','hdpe','26','16','Yes','Defective product sample','Customer has color bleeding issue in said lot material.kindly sort it out and revert with solution ASAP.','Muhammad Sohail','m.sohail@binrasheed.com','Approved','C-20210409011754-KSFTrizoneindustries8.4.2021.doc','Apr','2021','2021-04-28 11:38',NULL,NULL),(27,'2021-04-10','2','Sales','Green','Pak Agro Packaging Pvt Ltd','SU-81993','April 2021 Lot','In-Process Testing','hdpe nets','Not-Applicable ','hdpe','16','1','No','','Said lot material is changing its shade during processing.some of its pigments is going to fade so kindly sort it out and revert with solution ASAP.its top urgent matter so kindly evaluate it on priority basis.\r\nCustomer\'s processing parameters had been shared with R/D depart.','Muhammad Sohail','m.sohail@binrasheed.com','Completed','','Apr','2021','2021-04-10 13:09','2021-05-07','Further trials recommended'),(28,'2021-04-10','2','Sales','Beige/Brown/Chocolate','Pak Agro Packaging Pvt Ltd','Zero Caliberation Box CM-A32','March 2021 development CM-51610','In-Process Testing','hdpe nets','Not-Applicable ','hdpe','16','1','Yes','Defective and Standard Sample','Said development i,e CM-51610 is not asper standard as it cause shade variation.customer\'s processing parameters along with defective samples had been share with R/D team and also attached with this complaint kindly look into it and share new BR sample accordingly.Customer wants it on urgent basis.','Muhammad Sohail','m.sohail@binrasheed.com','Approved','C-20210410061748-WhatsAppImage2021-04-08at12.12.25PM.jpeg','Apr','2021',NULL,NULL,NULL),(29,'2021-04-15','2','Sales','Beige/Brown/Chocolate','Frontier Paper Products (Pvt) Ltd ','BR-TP 52','not available','Finished Good Testing','pp woven sacks','Not-Applicable ','pp','7','42','Yes','Defective product sample','Customer was using TP-50 since long without complaint . 3-4 months ago complaint appear as carbon and foam development . Replace the calpit with TP-52 . Improved carbon problem but  Foaming still exist .Improve 2-3 times the grade and final result is Water Carrying  as well as foaming . Video of complaint is shared with Mr. Suhail in prod .\r\nMatter is very serious as customer may be shifted on other brand if not handled urgently .','Syed Israr Ul Hasan','israr@binrasheed.com','Completed','','Apr','2021','2021-04-28 11:22','2021-04-28','Further trials recommended'),(30,'2021-04-16','5','Sales','Black','CHERAT PACKAGING LIMITED','Black ink for paper sack','All Batches','In-Process Testing','Flexo Printing','Pure','Cement Sack','17','35','No','','Customer Email:\r\n\"As communicated earlier verbally, your inks are badly damaging our equipment though shades are very bright and good but need to address the issue on top priority to avoid our losses.\r\n\r\nIntensity of problem can be measured by damaged blade measurement that it worn out 7-8 mm blade before 24 hours running.\r\n\r\nNeeds your feedback immediately.\r\n\r\nSnaps of damaged printing plates and doctor blades are attached please\"','Muhammad Waqas','Muhammad.waqas@Binrasheed.com','Completed','C-20210416053126-IMG_20210413_101539.jpg','Apr','2021','2021-04-17 06:27','2021-04-17','Further trials recommended'),(31,'2021-04-22','5','Sales','Blue','ROSHAN PACKAGES LTD','Nestle Blue ink for AQF','20-04-21','Intial Testing','Flexo Printing','Pure','Corrugated Box','17','35','Yes','Defective product sample','Particles in ink.','Muhammad Waqas','Muhammad.waqas@Binrasheed.com','Completed','C-20210422070435-PakistanCoatingChemicals20-4-21.doc','Apr','2021','2021-04-22 12:30','2021-04-24','Material Return'),(32,'2021-04-22','5','Sales','Blue','ROSHAN PACKAGES LTD','Cyan ink for AQF','20-04-21','Intial Testing','Flexo Printing','Pure','Corrugated Box','17','35','Yes','Defective product sample','Particles in ink.','Muhammad Waqas','Muhammad.waqas@Binrasheed.com','Completed','C-20210422070547-PakistanCoatingChemicals20-4-21.doc','Apr','2021','2021-04-22 12:27','2021-04-24','Customer Consumed Material Conditionally'),(33,'2021-06-01','2','Sales','White','REHAN CAN (PRIVATE) LIMITED','HA-1132B','21-05-21','Finished Good Testing','Paint Buckets','Available - 1%','PP','1','1','Yes','Defective and Standard Sample','3 Ton Material was made in this Lot. 2 Ton send earlier has no complaint while the last 1 ton is showing shade variation. We think that customer is manipulating things and so that\'s why we have send standard and our Mb Results to lab so that they can compare with standards provided to us previously.  ','Mustafa Kashif','mb.kashif@binrasheed.com','Pending','C-20210601072508-67d0c1a9-bf61-4760-8247-00deeb6800d4.jpg','Jun','2021',NULL,NULL,NULL);

