insert  into `concern_dept`(`serno`,`app_date_con`,`suggestion`,`suggestion2`,`suggestion3`,`comp_nature`,`cyear`,`file_uploaded`,`objection`,`objremarks`,`objectDate`,`production_line`,`shifts`) values (9,'2021-01-11 10:47:00','As','Change ','Fix raw material','Non-Justified/Non-Genuine \r\n',2021,'','Kindly dont change raw material',NULL,NULL,NULL,NULL),(10,'2021-01-18 10:05:00','dedees','wsxx','kjlllll','Justified/Genuine',2021,'','asa','jkj','2021-01-18 10:07',NULL,NULL),(11,'2021-01-18 11:06:00','batch evaluation','Evaluation batch','xyz','Non-Justified/Non-Genuine \r\n',2021,'','dfhhj',NULL,NULL,NULL,NULL),(14,'2021-02-16 04:31:00','no issue','We have evaluated sample of mentioned lot in anionic binder. Results are as per standard .No agglomerates were found , nothing unusual behavior is observed in mixed material . For your reference i have attached video as well . Product is manufactured on same parameters and there is no raw material change.','no issue in product ','Not-Justified\r\n',2021,'C-20210216043148-20210216_091843.jpg','The complaint was thoroughly investigated and no unusual  behaviour was observed.',NULL,NULL,'Line-1','Morning'),(15,'2021-02-16 04:34:00','Material will be replaced by new manufactured lot.','We have analysed raised complaint in mentioned batch # .Strength is slightly low .','formulation is revised and adjusted to avoid re-occurrence of this issue ','Justified',2021,'','Complaint Justified ',NULL,NULL,'Line-1','Morning'),(16,'2021-02-16 04:42:00','We have requested for standard sole , ready to use Polyol and ISO from customer to re-match this shade.','Customer approved this shade in October and after that he had asked for bulk material in which he made requests to vary colors sometimes to increase black , sometimes to increase red so each lot delivered to customer was optimized as per customer request.Last 3 supplies were delivered on same strength and shade . Now customer is considering standard sole , we need to know which lot # he used to taken out this sole so that we may deliver them supply matched with that lot # .\r\n  ','We can only avoid such issue if customer doesn\'t adjust shade by adding different colors to delivered paste . He must mention us lot# of our supply which he considering standard lot.\r\nWe always need complete information from customer side to resolve such issues','Insufficient-Information\r\n',2021,'','The customer adjusted the colour of different batches on his own,  They should inform us the batch number and the quantity added to adjust colour so that next batch is matched with the colour they developed themselves.',NULL,NULL,'Line-1','Morning'),(27,'2021-04-10 12:37:00','We are modifying our product according to end application parameters (especially according to actual processing temperatures).\r\nWe are providing new modified sample within 1 to 2 working days.\r\n','As per previous info of BD person according to the CMR providing info processing temperature range is (120c to 180c) and (180 to 220c) so we have develop the grade SU-81993 according these parameters while our material even though is stable above 230c to 240c but the customer process clearly shows working temperature was started from 315c ends at 330c when such higher temperature used there is a possibility that our conventional pigment could fade.','1-From on word Tarpaulin HDPE process heat stability range should be clearly defined as per actual processing temperatures.\r\n2-Less stable pigment would not be selected from R&D side to avoid these like issues in future.\r\n3-Customer is pre informed about price matters due to use of highly stable materials.\r\n','Justified',2021,'C-20210410123743-CMR02.jpg',NULL,NULL,NULL,'Line-1','Morning'),(28,'2021-04-10 12:48:00','We are modifying our product according to end application parameters (especially according to actual processing temperatures).\r\nWe are providing new modified sample within 1 to 2 working days.\r\n','As per previous info of BD person according to the CMR providing info processing temperature range is (120c to 180c) so we have develop the grade CM-51610 according these parameters while our material even though is stable above 230c to 240c but the customer process clearly shows working temperature was started from 315c ends at 330c when such higher temperature used there is a possibility that our conventional pigment could fade.','1-From on word Tarpaulin Hdpe process heat stability range should be clearly defined as per actual processing temperatures.\r\n2-Less stable pigment would not be selected from R&D side to avoid these like issues in future.\r\n3-Customer is pre informed about price matters due to use of highly stable materials.\r\n','Justified',2021,'C-20210410124824-CMR03.jpg',NULL,NULL,NULL,'Line-7','Night'),(25,'2021-04-15 12:16:00','Customer told us about complaint very late, and was not agree to perform another trial. And returned the remaining quantity of BR-1507.\r\n','UV stabilizers were not used in this product. And on customer\'s end residence time for the last shot on injection molding was greater, due which this heat stability issue occurred.','new sample with UV stabilizer and anti oxidants will be made. ','Justified',2021,'','It  was a trial complaint and it was  approximately 2 years ago when SMDE was operational from Unit 02',NULL,NULL,'Line-1','Morning'),(30,'2021-04-17 05:59:00','R&D team recommended a visit of technical sales manager (Basheer Sab) at the customer.','We have double checked the QC sample to insure quality, there is no fault found in it. Also, after the discussion with R&D team, it is found that no material or ingredient of ink was replaced since first supply. They also mentioned that there is no such ingredient in INK that could cause such problem to the equipment. To find the root cause of this problem,R&D team recommended a visit of technical sales manager (Basheer Sab) at the customer. \r\nThanks','As there is no root cause found up till now, therefore it is not possible to take any corrective action. ','Not-Justified\r\n',2021,'',' The complaint was investigated in R&D and no abnormality was observed from previous batches. All Parameters are with in spec eg particle size, viscosity .  I also suggest that Mr. Bashir should visit the customer and find out the root cause.',NULL,NULL,'',''),(26,'2021-04-21 13:17:00','Necessary measures have been taken and the material that was causing migration has been overcome by the stable materials. And a new grade has been developed for the customer. ','We have dispatched 1100 bags with same recipe and customer returned only 200 bags with migration issue. All the material was produced with same recipe and ingredients. In the last supply, migration has been found good (4/5) instead of excellent hence migration occurred at certain conditions. But the same behavior has been observed in the provided STD against BR-3137N. Both grades have shown equal migration properties but customer is not willing to run remaining 200 bags. Shade card is attached for the reference. Migration properties are found 4/5 instead of 5/5. ',' From now on migration test will be conducted on each lot for the said customer.','Not-Justified\r\n',2021,'C-20210421011742-IMG_20210420_142905.jpg','please mention the issue in detail about the pigment quality ','Already updated above.','2021-04-28 14:54','Line-3','Night'),(32,'2021-04-22 12:14:00','Visited customer to discuss the issue.','During visit, particles were negligible in ink so customer agreed to accept the material again.','To prevent future happening, R&D team will reformulate the white so that this issue is resolved permanently.','Not-Justified\r\n',2021,'',' Although the customer agreed to use the product but the issue is not fully resolved . R&D team will work the recurrence of the issue. ',NULL,NULL,'',''),(31,'2021-04-22 12:22:00','Visited customer and convinced him to run a trial on 10 kg ink and report any possible printing issues because customer made a visual judgement without running a trial','Our white ink has very small particles which are causing issue in mixing shades containing white.','R&D team should re formulate white to correct the issue.','Justified',2021,'','R&D team will work to reformulate the product.',NULL,NULL,'',''),(23,'2021-04-22 12:25:00','Testing has been done','This complain was added for practice by compliance team.','Ali Gohar please do not add such complains in future','Not-Justified\r\n',2021,'','testing complaint',NULL,NULL,'',''),(29,'2021-04-25 07:39:00','We developed new recipe to eliminate the issue of water carry and improve additives in the recipe as per customer requirement. so send the new develop master batch to customer at least 4 to 10 bags and take feed back from the customer. Coordinate with Sohail Haider for product availability.','This grade is suitable to use in PP raffia application at certain parameters including plant speed and denier. Subject customer\'s parameters are different so modification required for this customer .','We will develop the new grade for the customer and after getting approval , we will lock the recipe and will take strict quality measures. ','Justified',2021,'','Please send them Regular grade of TP-52 which was recently supplied to ultrapack \r\n',NULL,NULL,'Line-10','Morning');

